import React, { Component } from 'react'
import countries from "../../countries.json";

const CountryDetails = (props) => {
    const country = countries.find(country => country.cca3 === props.match.params.index);
    return (
        <>
            <p>{country.capital}</p>
            <p>{country.area}</p>
        </>
    )
}

export default CountryDetails
